import { Component } from "react";

class Pedidos extends Component {

    cargarPedido = (fecha, cantidad, nombreCliente, importe) => {

        const [pedido, setPedido] = useState({
            id: "",
            fecha: fecha,
            cantidad: cantidad,
            nombreCliente: nombreCliente,
            importe: importe
        });

        return pedido;
    }

}

export default Pedidos;
